import React from "react";
import NavBar from "./NavBar";
import Hero from "./Hero";
import Footer from "./Footer";
import Contact from "./Contact";
import Jokes from "./Jokes";
import Title from "./Title";
import './App.css'
import first from './images/pretty-drops.jpg' 
import second from './images/pretty-bubble.jpg' 
import third from './images/pretty-waves.jpg' 
import fourth from './images/superb-vase.jpg'
export default function App() {
    return (
        <div>
            <Title />
           <Jokes 
              setup={1}
              punchline="I can't wait to see her face light up when she opens it"  
           />
            <Jokes 
                setup="How did the hacker escape the police?"
                punchline="He ran somewhere"
            />
            <Jokes 
                setup="Why don't privates travel on mountain roads?"
                punchline="Scurvy"
            />
            <Jokes 
                setup="Why do bees stay in the hive on winter?"
                punchline="Swarm"
            />
            <Jokes 
                setup="What's the best thing about Switzerland"
                punchline="I don't know, but the flag is a big plus"
            />
            <Jokes
                punchline="It's hard to explain puns to kleptomaniacs because they always take things literally"
            />
        </div>
       
    );
}
